    "df['gander']=np.where(df['group_id'].isin([\"W\", \"X\", \"Y\",\"Z\"]), \"male\", \"female\")\n",
    "df=df.groupby(by=[\"15min_bin\", \"event_type\", \"animal_id\", \"group_id\", \"gander\", \"id_cohort\"], as_index=False).mean()\n",
