    "        t=df[(df[\"gander\"]==i) & (df[\"event_type\"]==j)].copy()\n",
    "        t=t.rename(columns={\"15min_bin\": \"min_15bin\"})\n",
    "        \n",
    "        plot=sns.pointplot(data=t, x=\"min_15bin\", y=\"ori_index_event\", capsize=.01, errorbar=('ci', 68))\n",
